import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import { jsonData } from "./"
const data = [
  {    
  "id": 1,    
  "gender": "Female",    
  "first_name": "Helen",
  "last_name": "Nguyen",
  "email": "hnguyen0@bloomberg.com",
  "ip_address": "227.211.25.18"
  }, {
  "id": 2,
  "gender": "Male",
  "first_name": "Carlos",
  "last_name": "Fowler",
  "email": "cfowler1@gnu.org",
  "ip_address": "214.248.201.11"
  }];

  function loops(){ 

    data.forEach(element => {
      alert("Name: " + element.first_name + ", " + element.last_name);
      alert("Email: " + element.email);
    });
  }

const itse = [1, 2, 3, 4, 5];
const listItems = itse.map((number) => 
    <h1>{number}</h1>
)

class App extends Component {

  render() {

    return (
      loops(),
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            Edit <code>src/App.js</code> and save to reload.
          </p>
          {
            data.forEach(element => {
              <div> { element.email.value } </div>
            })
          }
          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
          </a>
        </header>
      </div>
    );
  }
}

export default App;
